drop table TELLER Cascade Constraints;
drop table CUSTOMER Cascade Constraints;
drop table EDUBANK_SECURITY_QUESTION Cascade Constraints;
drop table CUSTOMER_LOGIN Cascade Constraints;
drop table BRANCH Cascade Constraints;
drop table ACCOUNT Cascade Constraints;
drop table ACCOUNT_CUSTOMER_MAPPING Cascade Constraints;
drop table DEBIT_CARD Cascade Constraints;
drop table TRANSACTION Cascade Constraints;

CREATE TABLE TELLER (
	TELLER_ID NUMBER(3),
	LOGIN_NAME VARCHAR2(5) UNIQUE NOT NULL,
	PASSWORD VARCHAR2(100) NOT NULL,
	CONSTRAINT PS_TELLER_ID_PK PRIMARY KEY ( TELLER_ID )
);

CREATE TABLE CUSTOMER (
	CUSTOMER_ID NUMBER(10),
	EMAILID VARCHAR2(255) UNIQUE NOT NULL,
	NAME VARCHAR2(100) NOT NULL,
	DATE_OF_BIRTH DATE NOT NULL,
	SECURITY_QUESTION_ID NUMBER(6),
	SECURITY_ANSWER VARCHAR2(100),
	CREATED_TIMESTAMP TIMESTAMP NOT NULL,
	CREATED_BY NUMBER(3) NOT NULL,
	MODIFIED_TIMESTAMP TIMESTAMP,
	MODIFIED_BY NUMBER(3),
	CONSTRAINT PS_CUSTOMER_ID_PK PRIMARY KEY ( CUSTOMER_ID )
);

CREATE TABLE CUSTOMER_LOGIN (
	CUSTOMER_LOGIN_ID NUMBER(6),
	LOGIN_NAME VARCHAR2(20) UNIQUE NOT NULL,
	PASSWORD VARCHAR2(100) NOT NULL,
	CUSTOMER_ID NUMBER(10) NOT NULL,
	LOCKED_STATUS VARCHAR2(10) DEFAULT 'UNLOCKED' NOT NULL, -- 'LOCKED'/'UNLOCKED'
	MODIFIED_TIMESTAMP TIMESTAMP,
	CONSTRAINT PS_CUSTOMER_LOGIN_ID_PK PRIMARY KEY ( CUSTOMER_LOGIN_ID )
);

CREATE TABLE BRANCH (
	BRANCH_ID NUMBER(4),
	IFSC VARCHAR2(11) UNIQUE NOT NULL,
	BRANCH_NAME VARCHAR2(50) NOT NULL,
	BRANCH_CODE VARCHAR2(6) NOT NULL,
	CONSTRAINT PS_BRANCH_ID_PK PRIMARY KEY ( BRANCH_ID )
);

CREATE TABLE ACCOUNT (
	ACCOUNT_ID NUMBER(6),
	ACCOUNT_NUMBER VARCHAR2(15) UNIQUE NOT NULL,
	BRANCH_ID NUMBER(4) NOT NULL,
	BALANCE NUMBER(12,4) NOT NULL,
	LOCKED_BALANCE NUMBER(12,4) DEFAULT 0 NOT NULL,
	ACCOUNT_STATUS VARCHAR2(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CONSTRAINT PS_ACCOUNT_ID_PK PRIMARY KEY ( ACCOUNT_ID )
);

CREATE TABLE ACCOUNT_CUSTOMER_MAPPING (
	ACCOUNT_CUSTOMER_MAPPING_ID NUMBER(6),
	ACCOUNT_NUMBER VARCHAR2(15) NOT NULL,
	CUSTOMER_ID NUMBER(10) NOT NULL,
	MAPPING_STATUS VARCHAR2(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CONSTRAINT PS_ACCOUNT_CUSTOMER_MAPP_ID_PK PRIMARY KEY ( ACCOUNT_CUSTOMER_MAPPING_ID )
);

CREATE TABLE DEBIT_CARD (
	DEBIT_CARD_ID NUMBER(6),
	DEBIT_CARD_NUMBER VARCHAR2(16) NOT NULL UNIQUE,
	ACCOUNT_CUSTOMER_MAPPING_ID NUMBER(6) NOT NULL,
	CVV VARCHAR2(100) NOT NULL,
	VALID_FROM DATE DEFAULT SYSDATE NOT NULL,
	VALID_THRU DATE DEFAULT (SYSDATE+3650) NOT NULL,
	PIN VARCHAR2(100) NOT NULL,
	LOCKED_STATUS VARCHAR2(10) DEFAULT 'UNLOCKED' NOT NULL, -- 'LOCKED'/'UNLOCKED'
	DEBIT_CARD_STATUS VARCHAR2(10) DEFAULT 'ACTIVE' NOT NULL, -- 'ACTIVE'/'INACTIVE'
	CREATED_TIMESTAMP TIMESTAMP NOT NULL,
	CREATED_BY NUMBER(3) NOT NULL,
	MODIFIED_TIMESTAMP TIMESTAMP,
	CONSTRAINT PS_DEBIT_CARD_ID_PK PRIMARY KEY ( DEBIT_CARD_ID )
);

CREATE TABLE TRANSACTION (
	TRANSACTION_ID NUMBER(10),
	ACCOUNT_NUMBER VARCHAR2(15) NOT NULL,
	AMOUNT NUMBER(12,4) NOT NULL,
	TRANSACTION_DATE_TIME TIMESTAMP DEFAULT SYSTIMESTAMP NOT NULL,
	TYPE VARCHAR2(10) NOT NULL, -- 'CREDIT'/'DEBIT'
	TRANSACTION_MODE VARCHAR2(20) NOT NULL,
	REMARKS VARCHAR2(30),
	INFO VARCHAR2(200) NOT NULL,
	CREATED_BY VARCHAR2(50) NOT NULL,
	CONSTRAINT PS_TRANSACTION_ID_PK PRIMARY KEY ( TRANSACTION_ID )
);

CREATE TABLE EDUBANK_SECURITY_QUESTION (
	QUESTION_ID NUMBER(10),
	QUESTION VARCHAR2(255) UNIQUE NOT NULL,
	CONSTRAINT EDU_SQ_QUESTION_ID_PK PRIMARY KEY ( QUESTION_ID )
);

ALTER TABLE CUSTOMER ADD CONSTRAINT PS_CUSTOMER_CREATED_BY_FK FOREIGN KEY ( CREATED_BY ) REFERENCES TELLER( TELLER_ID );
ALTER TABLE CUSTOMER ADD CONSTRAINT PS_CUSTOMER_MODIFIED_BY_FK FOREIGN KEY ( MODIFIED_BY ) REFERENCES TELLER( TELLER_ID );
ALTER TABLE CUSTOMER ADD CONSTRAINT PS_SEC_QUES_ID_FK FOREIGN KEY ( SECURITY_QUESTION_ID ) REFERENCES EDUBANK_SECURITY_QUESTION( QUESTION_ID );

ALTER TABLE CUSTOMER_LOGIN ADD CONSTRAINT PS_LOGIN_LOCKED_STATUS_CK CHECK (LOCKED_STATUS in ('LOCKED','UNLOCKED'));
ALTER TABLE CUSTOMER_LOGIN ADD CONSTRAINT PS_LOGIN_CUSTOMER_ID_FK FOREIGN KEY ( CUSTOMER_ID ) REFERENCES CUSTOMER( CUSTOMER_ID );

ALTER TABLE ACCOUNT ADD CONSTRAINT PS_ACCOUNT_BALANCE_CK CHECK (BALANCE >= 0);
ALTER TABLE ACCOUNT ADD CONSTRAINT PS_ACCOUNT_LOCKED_BALANCE_CK CHECK (LOCKED_BALANCE >= 0);
ALTER TABLE ACCOUNT ADD CONSTRAINT PS_ACCOUNT_STATUS_CK CHECK (ACCOUNT_STATUS in ('ACTIVE','INACTIVE'));
ALTER TABLE ACCOUNT ADD CONSTRAINT PS_ACCOUNT_BRANCR_ID_FK FOREIGN KEY ( BRANCH_ID ) REFERENCES BRANCH( BRANCH_ID );

ALTER TABLE ACCOUNT_CUSTOMER_MAPPING ADD CONSTRAINT PS_ACC_CUST_MAPNG_STATUS_CK CHECK (MAPPING_STATUS in ('ACTIVE','INACTIVE'));
ALTER TABLE ACCOUNT_CUSTOMER_MAPPING ADD CONSTRAINT PS_ACC_CUST_MAPNG_ACC_NO_FK FOREIGN KEY ( ACCOUNT_NUMBER ) REFERENCES ACCOUNT( ACCOUNT_NUMBER );
ALTER TABLE ACCOUNT_CUSTOMER_MAPPING ADD CONSTRAINT PS_ACC_CUST_MAPNG_CUST_ID_FK FOREIGN KEY ( CUSTOMER_ID ) REFERENCES CUSTOMER( CUSTOMER_ID );
ALTER TABLE ACCOUNT_CUSTOMER_MAPPING ADD CONSTRAINT PS_ACC_CUST_MAPNG_A_NO_C_ID_UQ UNIQUE(ACCOUNT_NUMBER, CUSTOMER_ID);

ALTER TABLE DEBIT_CARD ADD CONSTRAINT PS_DEBIT_CARD_AC_NO_MPNG_ID_FK FOREIGN KEY ( ACCOUNT_CUSTOMER_MAPPING_ID ) REFERENCES ACCOUNT_CUSTOMER_MAPPING( ACCOUNT_CUSTOMER_MAPPING_ID );
ALTER TABLE DEBIT_CARD ADD CONSTRAINT PS_DEBIT_CARD_CREATED_BY_FK FOREIGN KEY ( CREATED_BY ) REFERENCES TELLER( TELLER_ID );
ALTER TABLE DEBIT_CARD ADD CONSTRAINT PS_DEBIT_CARD_LOCKED_STATUS_CK CHECK (LOCKED_STATUS in ('LOCKED','UNLOCKED'));
ALTER TABLE DEBIT_CARD ADD CONSTRAINT PS_DEBIT_CARD_STATUS_CK CHECK (DEBIT_CARD_STATUS in ('ACTIVE','INACTIVE'));

ALTER TABLE TRANSACTION ADD CONSTRAINT PS_TRANSACTION_ACC_NUMBER_FK FOREIGN KEY ( ACCOUNT_NUMBER ) REFERENCES ACCOUNT( ACCOUNT_NUMBER );
ALTER TABLE TRANSACTION ADD CONSTRAINT PS_TRANSACTION_AMOUNT_CK CHECK (AMOUNT > 0);
ALTER TABLE TRANSACTION ADD CONSTRAINT PS_TRANSACTION_TYPE_CK CHECK (TYPE in ('CREDIT','DEBIT'));


